    const [pokemon, setPokemon] = useState('bulbasaur');
    const [loading, setLoading] = useState(true);


    return <main className="container content">
        {loading ? <Preloader /> : pokemon}
        <ItemsList pokemon={pokemon}/>
    </main>
}

